import React from 'react';
import {Link} from "react-router-dom";

const Navbar = () => {
    async function topStories(){
        let url="https://api.rss2json.com/v1/api.json?rss_url=https%3A%2F%2Ftimesofindia.indiatimes.com%2Frssfeedstopstories.cms";
        let data=await fetch(url);
        let parsedData=data.json();
        console.log(parsedData.items);
    }
  return (
    <div className="nav">
    <input type="checkbox" id="check" />
    <label htmlFor="check" className='checkbtn'>
    <i className="fa-sharp  fa-solid fa-bars"></i>
    </label>
    <img src="newsexpress.png" alt="News logo" className='logo' />
    <ul>
        <li><Link to="/" onClick={topStories}>HOME</Link></li>
        <li><Link to="/about">SPORTS</Link></li>
        <li>SCIENCE</li>
        <li>ENVIRONMENT</li>
        <li>TECHNOLOGY</li>
        <li>ENTERTAINMENT</li>
    </ul>
    </div>
  )
}

export default Navbar;
